import React from "react";
import "./Navbar.css";
import logo from "./images/logoimg.png";
import callicon from "./images/support.svg";
import computer from "./images/computer.png";
const Navbar = () => {
  return (
    <div>
      <div className="  logovscall">
        <div className="row">
          <div class="col-6 col-sm col-md col-lg logodiv ">
            <img className="ml-5" src={logo} />
            <p>
              FIZMA<span className="spanfor_soft">SOFT</span>
            </p>
          </div>
          <div class="col-6 col-sm col-md col-lg">
            <div className="row call_section  ">
              <div className="call_icon mr-4">
                <img src={callicon} />
              </div>
              <div className="call_num">
                <p>(90)777 77 07</p>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* <div className="backg_img">
        <img src={computer} />
        <footer className="idea_imp_res">
          <p className="idea">IDEA</p>
          <p className="implement">IMPLEMENT</p>
          <p className="result">RESULT</p>
        </footer>
      </div> */}
    </div>
  );
};

export default Navbar;
